import React from 'react';
import { motion } from 'framer-motion';
import performanceimg from '../assets/images/performance.png';
import { TrendingUp, Users, Award } from 'lucide-react';

const CyberIncidentsStats = () => {
  // Animation variants
  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2
      }
    }
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: {
      opacity: 1,
      y: 0,
      transition: {
        duration: 0.6
      }
    }
  };

  // Stats data
  const stats = [
    {
      title: "#1 Platform",
      value: "Informatika",
      icon: Award,
      color: "cyan"
    },
    {
      title: "Success Rate",
      value: "95%",
      icon: TrendingUp,
      color: "green"
    },
    {
      title: "Industry Partners",
      value: "50+",
      icon: Users,
      color: "blue"
    }
  ];

  return (
    <div className="px-4 py-16 mx-auto max-w-7xl md:py-24">
      {/* Stats Grid */}
      <motion.div
        variants={containerVariants}
        initial="hidden"
        whileInView="visible"
        viewport={{ once: true }}
        className="grid grid-cols-1 gap-6 mb-16 md:grid-cols-3"
      >
        {stats.map((stat, index) => (
          <motion.div
            key={stat.title}
            variants={itemVariants}
            className="p-6 transition-all duration-300 border bg-gray-800/50 backdrop-blur-sm rounded-xl border-gray-700/50 hover:border-cyan-500/50"
          >
            <stat.icon className={`w-8 h-8 text-${stat.color}-400 mb-4`} />
            <div className="space-y-1">
              <p className="text-sm text-gray-400">{stat.title}</p>
              <p className="text-2xl font-bold text-white">{stat.value}</p>
            </div>
          </motion.div>
        ))}
      </motion.div>

      {/* Main Stats Grid */}
      <motion.div
        variants={containerVariants}
        initial="hidden"
        whileInView="visible"
        viewport={{ once: true }}
        className="grid gap-6 md:grid-cols-2"
      >
        {/* Percentage Card */}
        <motion.div
          variants={itemVariants}
          className="p-8 transition-all duration-300 border bg-gray-800/50 backdrop-blur-sm rounded-xl border-gray-700/50 hover:border-cyan-500/50"
        >
          <motion.div 
            initial={{ scale: 0 }}
            animate={{ scale: 1 }}
            transition={{ duration: 0.6, delay: 0.3 }}
            className="flex items-center gap-4 mb-6"
          >
            <div className="p-3 rounded-lg bg-cyan-500/10">
              <Users className="w-6 h-6 text-cyan-400" />
            </div>
            <h3 className="text-xl font-semibold text-white">Student Statistics</h3>
          </motion.div>

          <motion.p
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.4 }}
            className="mb-4 text-6xl font-bold text-cyan-400"
          >
            38%
          </motion.p>

          <motion.p
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.5 }}
            className="text-xl leading-relaxed text-gray-300"
          >
            Siswa/Siswi di indonesia Kurang dalam problem solving Programming mereka
          </motion.p>
        </motion.div>

        {/* Performance Card */}
        <motion.div
          variants={itemVariants}
          className="p-8 transition-all duration-300 border bg-gray-800/50 backdrop-blur-sm rounded-xl border-gray-700/50 hover:border-cyan-500/50"
        >
          <motion.div 
            initial={{ scale: 0 }}
            animate={{ scale: 1 }}
            transition={{ duration: 0.6, delay: 0.3 }}
            className="flex items-center gap-4 mb-6"
          >
            <div className="p-3 rounded-lg bg-blue-500/10">
              <TrendingUp className="w-6 h-6 text-blue-400" />
            </div>
            <h3 className="text-xl font-semibold text-white">Performance Metrics</h3>
          </motion.div>

          <motion.p
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.4 }}
            className="mb-6 text-3xl font-semibold text-white"
          >
            Tingkatkan <br/> Performa <br/> Programmingmu.
          </motion.p>

          <motion.div
            initial={{ opacity: 0, scale: 0.8 }}
            animate={{ opacity: 1, scale: 1 }}
            transition={{ duration: 0.6, delay: 0.5 }}
            className="relative h-48"
          >
            <div className="absolute inset-0 bg-gradient-to-b from-transparent to-gray-800/50"></div>
            <img 
              src={performanceimg} 
              alt="Graph showing performance optimization" 
              className="object-cover w-full h-full rounded-lg"
            />
          </motion.div>
        </motion.div>

      </motion.div>
    </div>
  );
};

export default CyberIncidentsStats;
